// ReLU function which will be used as activation functions for our neurons.
void relu(float &num){
	if(num < 0)
		num = 0;
}

// Linear function which will be used as activation function in the last layer.
void linear(float &num){
	return;
}

/*
* Function to compute the output value for each neuron of a given layer
* Params: 
*  inp: an array containing the input values to the current layer
*  curr: the array that will contain the output for each neuron of the current layer
*  theta: a 2-d array that stores the weights for each neuron of current layer
*  neurons_in_current_layer: the number of neurons in current layer
*  input_dimensions: size of the input vector
* Returns: void(null)
*/
void process_layer(float inp[], float curr[], float theta[][9], int neurons_in_current_layer, int input_dimension){
	curr[0] = 1;
	for(int i = 1; i < neurons_in_current_layer; ++i){
		curr[i] = 0;
		for(int j = 0; j < input_dimension; ++j){
			curr[i] += inp[j] * theta[i - 1][j];
		}
		relu(curr[i]);
	}	
}

